SELECT "Motos_1"."Marca" AS "Datos (copia)" FROM "Motos_1" WHERE (("Motos_1"."Categoria" IN ('CAMIONES', 'CAMIONES, BUSES Y PANELES', 'MOTOCICLETAS', 'PICK UPS, VANS Y JEEPS', 'PICK-UPS', 'SUV Y JEEPS', 'VEHICULOS NUEVOS')) AND (CAST(EXTRACT(YEAR FROM "Motos_1"."FECHA") AS BIGINT) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Motos_1"."FECHA") AS BIGINT) <= 2015)) GROUP BY "Motos_1"."Marca" ORDER BY "Datos (copia)" ASC ;
